import react from 'react';

// Dummy component
const MyNav = props => {
	return (
		<ul>
			<li>
				<a href="">News Feed</a>
			</li>
			<li>
				<a href="">Messages</a>
			</li>
			<li>
				<a href="">Watch</a>
			</li>
		</ul>
	);
};

// Export
export default MyNav;

// Styling
const styles = {
	myIcons: {
		height: '50px',
		cursor: 'pointer',
		borderRadius: '50%',
	},
};
